void cbAll(dyn_string dp, dyn_int val){

    nolink_back.visible(val[2]);
    nolink_text.visible(val[2]);

  switch(val[1]){
    case 0:
    case 1:
      btn_main.setAct(true);
      btn_res.setAct(false);
      btn_met.setAct(false);
      SHAPE_GROUP1.visible(true);
      SHAPE_GROUP2.visible(false);
      SHAPE_GROUP3.visible(false);
      break;
    case 2:
      btn_main.setAct(false);
      btn_res.setAct(true);
      btn_met.setAct(false);
      SHAPE_GROUP1.visible(false);
      SHAPE_GROUP2.visible(true);
      SHAPE_GROUP3.visible(false);
      break;
    case 3:
      btn_main.setAct(false);
      btn_res.setAct(false);
      btn_met.setAct(true);
      SHAPE_GROUP1.visible(false);
      SHAPE_GROUP2.visible(false);
      SHAPE_GROUP3.visible(true);
      break;
  }

  switch(val[3]){
    case 0:
    case 1:
      alrm_stop.backCol(&quot;Grey&quot;);
      break;
    case 2:
      alrm_stop.backCol(&quot;Red&quot;);
      break;
    default:
      alrm_stop.backCol(&quot;Yellow&quot;);
  }

}

